import random
import os
import json

try:
    import yaml
except Exception:
    yaml = None

def _load_polygons_from_file(test_set: int, maps_dir: str | None) -> list[list[tuple[float, float]]] | None:
    """
    maps_dir/test_set.(json|yaml|yml) 혹은 관례명 파일을 찾아서 로드.
    스키마:
      - 권장: {"polygons": [ [[x,y],...], ... ]}
      - 혹은 top-level이 곧바로 폴리곤 리스트여도 허용.
    """
    if not maps_dir or not os.path.isdir(maps_dir):
        return None

    base_names = [
        f"{test_set}",
        {1: "random_full", 11: "random_mini", 2: "dept_store", 22: "dept_store_mini",
         3: "warehouse", 33: "warehouse_mini", 4: "recording", 44: "recording_mini", 444: "recording_micro"}.get(test_set, None)
    ]
    base_names = [b for b in base_names if b]

    candidates = []
    for b in base_names:
        candidates += [os.path.join(maps_dir, f"{b}.json"),
                       os.path.join(maps_dir, f"{b}.yaml"),
                       os.path.join(maps_dir, f"{b}.yml")]

    for path in candidates:
        if not os.path.isfile(path):
            continue
        try:
            if path.endswith(".json"):
                with open(path, "r", encoding="utf-8") as f:
                    data = json.load(f)
            else:
                if yaml is None:
                    continue
                with open(path, "r", encoding="utf-8") as f:
                    data = yaml.safe_load(f)

            polygons = data.get("polygons", data)
            polygons = [[tuple(map(float, pt)) for pt in poly] for poly in polygons]
            return polygons
        except Exception:
            continue
    return None

